import React, { Component } from "react";
import Product from "./Product";
import Title from "./Title";
import "./default.css";
import { ProductConsumer } from "../context.js";

export default class ProductList extends Component {
  render() {
    return (
      <React.Fragment>
        <div className="container">
          <Product />
        </div>
      </React.Fragment>
    );
  }
}
